import React from "react";
import Breadcrumbs from "./Breadcrumb";

const AdminHeader = () => {
  return (
    <div className="row mb-2">
      <div className="col-sm-6">
        <h5 className="m-0 text-dark" style={{ textAlign: "start" }}>
          Dashboard
        </h5>
      </div>

      <div className="col-sm-6">
        <Breadcrumbs />
      </div>
    </div>
  );
};

export default AdminHeader;
